// SVG container, handle resize
var body = d3.select("body");
var svg = body.append("svg")


var width = window.innerWidth,
    height = window.innerHeight;

var zoom = d3.zoom()
      .scaleExtent([1 / 2, 8])
      .on("zoom", zoomEvent),
    zoomtimer = null;
function zoomEvent() {
    if(zoomtimer == null){
      console.log('enter');
      d3.select('g.edges').style('display', 'none');
      svg.style("will-change", 'transform');
    } else {
      clearTimeout(zoomtimer);
    }

    zoomtimer = setTimeout(function(){
      zoomtimer = null;
      console.log('leave');
      d3.select('g.edges').style('display', null);
      svg.style("will-change", null);
    }, 1000);

  svg.style("transform", 'translate3d('
      +(d3.event.transform.x - width/2)+'px,'
      +(d3.event.transform.y - height/2)+'px, 0)scale('
      +d3.event.transform.k+')');
}
body.call(zoom);
zoom.transform(body, d3.zoomIdentity.translate(width/2, height/2).scale(1));


// Prepare data
function depth2radius(depth) { return Math.pow(depth / (maxdepth+1), 1/2) * radius; }

var elems = data.elems,
    edges_paths = data.edges_paths,
    N = data.Nnodes,
    maxdepth = data.maxdepth,
    leafAngleRadian = Math.PI * 2 / N,
    leafAngleDegree = 360 / N,
    radius = 9 / leafAngleRadian,
    leafs = Array.from(elems.slice(0,N), (leaf, index)=> {
        leaf.id = index;
        leaf.x = radius * Math.cos(index * leafAngleRadian);
        leaf.y = radius * Math.sin(index * leafAngleRadian);
        return leaf;
    }),
    clusters = Array.from(elems.slice(N), (cluster)=> {
        cluster.center = (cluster.leftmost + cluster.rightmost) / 2;
        cluster.startAngle = (cluster.leftmost - 1/2) * leafAngleRadian;
        cluster.endAngle = (cluster.rightmost + 1/2) * leafAngleRadian;

        cluster.innerRadius = depth2radius(cluster.depth) + 1;
        cluster.outerRadius = depth2radius(cluster.depth+1) - 1;
        cluster.padAngle = 10 / (cluster.innerRadius * 2 * Math.PI);

        cluster.x = cluster.innerRadius * Math.cos(cluster.center * leafAngleRadian);
        cluster.y = cluster.innerRadius * Math.sin(cluster.center * leafAngleRadian);
        return cluster;
    }
    );

// diagram root
var scale = 0.4 * Math.min(height, width) / radius;
var g = svg.append("g")
    .attr('id', 'root')
    .attr('transform', 'translate('+width/2+','+height/2+')scale('+scale+')');


// Actual drawing
swapaxis = g.append("g").attr("transform", "rotate(-90)");

var nodes = swapaxis.append("g")
    .attr("class", "nodes")
    .selectAll("text")
    .data(leafs).enter()
        .append("text")
        .text(d => d.name)
        .attr('fill', d => d.color)

nodes.filter(d => d.id <= N/2)
        .attr('transform', d => 'rotate(' + d.id*leafAngleDegree + ') translate(' + radius + ',0)' );

nodes.filter(d => d.id > N/2)
    .attr("text-anchor", "end")
    .attr('transform', d => 'rotate(' + d.id*leafAngleDegree + ') translate(' + radius + ',0)rotate(180)');

// swapaxis.append("g")
//     .attr("class", "nodestree")
//     .selectAll("circle")
//     .data(elems)
//     .enter().append("circle")
//         .attr("r", 1)
//         .attr("fill", 'red')
//         .attr('cx', d => d.x).attr('cy', d => d.y)


var line = d3.line().curve(d3.curveBundle.beta(0.9));
var edges = swapaxis.append("g")
    .attr("class", "edges")
    .selectAll("path")
    .data(edges_paths)
    .enter().append("path")
    .attr("d", path => line(path.map(i => [elems[i].x, elems[i].y])));


var clusterArcs = g.append("g")
    .attr("class", "clusters")
    .selectAll("path")
    .data(clusters)
    .enter()
        .append("path")
        .attr("d", d3.arc())

function highlight(leftmost, rightmost) {
    d3.event.stopPropagation()

    selected_leaves = new Set()
    edges.classed('selected', edge => {
        var from = edge[0],
            to = edge[edge.length-1]
        if((from >= leftmost && from <= rightmost) || (to >= leftmost && to <= rightmost))
        {
            selected_leaves.add(from);
            selected_leaves.add(to);
            return true;
        }
        return false;
    })
    nodes.attr('fill', d => selected_leaves.has(d.id) ? 'red' : d.color);
}
svg.on('click', () => highlight(-1, -1));
clusterArcs.on('click', d => highlight(d.leftmost, d.rightmost));
nodes.on('click', d => highlight(d.id, d.id));
